import React from "react";

export default function Reminder(props) {
  if (props.celsius > 20) {
    return <p> Don't forget to get the SPF </p>;
  } else if (props.description === "RAIN" || props.description === "FOG") {
    return <p> Don't forget to get the UMBRELLA </p>;
  } else {
    return <p> Don't forget to take VITAMIN D </p>;
  }
}
